              <h1>bio -> {item.bio}</h1>
              <h1>join_date -> {item.join_date}</h1>
              <h1>scholar_id_link -> {item.scholar_id_link}</h1>
              <h1>slug -> {item.slug}</h1>
              <h1>irns_link -> {item.irns_link}</h1>
              <h1>image -> {item.image}</h1>
              <h1>user -> {item.user}</h1>  
    </div>
      })}
  </div>
}
export default Testing
